import React from 'react';
import { createRoot } from 'react-dom/client';
import './index.css';
import App from './App';
import { ClerkProvider } from '@clerk/clerk-react';

// Make sure to add your Clerk Publishable Key to the .env file
// and create a .env file if you have not done so.
const PUBLISHABLE_KEY = process.env.REACT_APP_CLERK_PUBLISHABLE_KEY || 'your_clerk_publishable_key';

if (!PUBLISHABLE_KEY) {
  throw new Error("Missing Publishable Key. You can get your key at https://dashboard.clerk.com/last-active?path=api-keys.");
}

const container = document.getElementById('root');
const root = createRoot(container);

// The <ClerkProvider> component provides active session and user context to
// all Clerk components and hooks.
root.render(
  <React.StrictMode>
    <ClerkProvider publishableKey={PUBLISHABLE_KEY}>
      <App />
    </ClerkProvider>
  </React.StrictMode>
);
